import React from 'react'
import { MutableRefObject, useRef, WheelEvent, MouseEvent} from 'react';
import {Navbar,Nav,NavDropdown,Form,FormControl,Container} from 'react-bootstrap'
import {useNavigate} from 'react-router-dom';
import "./header.css"
const Header = () => {
    const scrollRef: MutableRefObject<HTMLDivElement | null> = useRef(null);
  const onWheel = (e: WheelEvent) => {
    const container = scrollRef.current;
    const scrollPos = container.scrollLeft;

    container.scrollTo({
      top: 0,
      left: scrollPos + e.deltaY,
    });
  };
    const navigate=useNavigate();
  return (
    <Navbar bg="primary" expand="lg" variant='dark'>
        <Container>
        <Navbar.Brand href="/">Pokedex</Navbar.Brand>
        <Navbar.Toggle aria-controls='basic-navbar-nav'/>
        <Navbar.Collapse id='basic-navbar-nav'>
            <Nav className='m-auto'>
            <Form inline>
                <FormControl type="text" placeholder="Search" classname="mr-sm-2"/>
            </Form>
            </Nav>
            <Nav >
                <Nav.Link href="home">My profiles</Nav.Link>
                <NavDropdown title="User" id="basic-nav-dropdown">
                    <NavDropdown.Item>My profile</NavDropdown.Item>
                    <NavDropdown.Divider />
                <NavDropdown.Item onClick={()=>{
                    localStorage.removeItem('UserInfo');
                    navigate("/");
                }}>Log Out</NavDropdown.Item>
                </NavDropdown>
            </Nav>
            
        </Navbar.Collapse>
        </Container>
        
    </Navbar>
  )
}

export default Header
